import React from 'react'
import PropTypes from 'prop-types'

export default function Navbar(props) {
  const DarkMode = () => {
    let color = document.getElementsByTagName("body")[0]; 
    if (color.style.backgroundColor === 'white') {
      color.style.backgroundColor = 'black';
      color.style.color = 'white';          
    } else {
      color.style.backgroundColor = 'white';
      color.style.color = 'black';          
    }
  };
  
  return (   
     <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
    <div className="container-fluid">
      <a className="navbar-brand" href="/">{props.title}</a>
      <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
        <span className="navbar-toggler-icon"></span>
      </button>
      <div className="collapse navbar-collapse" id="navbarSupportedContent">
        <ul className="navbar-nav me-auto mb-2 mb-lg-0">
          <li className="nav-item">
            <a className="nav-link active" aria-current="page" href="/">home</a>
          </li>
          <li className="nav-item">
            <a className="nav-link disabled" aria-disabled="true">{props.able}</a>
          </li>
          <li className="nav-item">
            <a className="nav-link active" aria-disabled="true">About</a>
          </li>
          <li className="nav-item">
          <button className='btn btn-primary my-3 mx-1'onClick={DarkMode}>Dark Mode</button>
          </li>
        </ul>
        <form className="d-flex" role="search">
          <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
          <button className="btn btn-primary" type="submit">Search</button>
        </form>
      </div>
    </div>
  </nav>
  )
}

Navbar.prototype = {
    title:PropTypes.string.isRequired,
    able:PropTypes.string.isRequired
}
